import glob
import hashlib
import os
import sys
from pathlib import Path
from shutil import copy2

import PySimpleGUIQt as Sg

img_base64 = b''


def main():
    file_names = [i for i in glob.glob("*.exe") if i != os.path.basename(sys.argv[0])]
    files_hash = ','.join(map(str, [hashlib.md5(open(i, "rb").read()).hexdigest() for i in file_names])).lower().split(
        ',')
    layout_main = []
    Sg.theme('DarkBlack1')
    for j in range(len(file_names)):
        new_name = Path(file_names[j]).resolve().stem
        layout_main += [[Sg.Text('', size=(11.8, 0.3), font='Any 3')],
                        [Sg.Checkbox(file_names[j], enable_events=True, key=f'SWITCH{j}'),
                         Sg.Text('to: ', size=(4, 0.7), font='Any 10'),
                         Sg.InputText(new_name, key=f'new-name{j}', size=(10, 0.7), font='Any 10'),
                         Sg.Text(files_hash[j], size=(25, 0.7), font='Any 10')],
                        [Sg.Text('', size=(3.7, 0.3), font='Any 3')],
                        [Sg.HorizontalSeparator()]]
    button_layout = [[Sg.Button('Change Name', size=(13, 0.8), key='BUTTON')]]
    layout = [[Sg.Text('', size=(11.8, 0.3), font='Any 3')],
              [Sg.Column(layout_main, size=(590, 250), scrollable=True)],
              [Sg.Column(button_layout, element_justification='r')]]

    window = Sg.Window("Add Tags", layout, icon=img_base64, resizable=False, finalize=True)
    while True:
        event, values = window.read()
        if event == Sg.WINDOW_CLOSED:
            window.close()
            break
        for j in range(len(files_hash)):
            if event == 'BUTTON':
                if values[f'SWITCH{j}']:
                    new_array = [values[f'new-name{j}'], files_hash[j]]
                    new_name = ' '.join(new_array)
                    old_file = file_names[j] + 'temp'
                    new_file = new_name
                    os.rename(file_names[j], old_file)
                    copy2(old_file, values[f'new-name{j}']+'.exe')
                    os.rename(old_file, new_file)
                    window.close()
                    main()
                    break


main()
